import React from 'react';
import moviesData from './moviesData';

// Componente MovieList que muestra una lista de pósters de películas
const MovieList = () => {
  return (
    <div>
      <h2>Lista de Pósters de Películas</h2>
      <div style={{ display: 'flex', flexWrap: 'wrap' }}>
        {moviesData.map((movie, index) => (
          <img
            key={index}
            src={movie.poster}
            alt={movie.title}
            style={{ width: '200px', margin: '10px' }}
          />
        ))}
      </div>
    </div>
  );
};

export default MovieList;
